import React from 'react';
import { Card, List } from 'antd';

const ProductList = ({ products }) => {
    return (
        <div>
            <h2>Products</h2>
            <List
                grid={{ gutter: 16, column: 4 }}
                dataSource={products}
                renderItem={product => (
                    <List.Item>
                        <Card title={product.name}>{product.category}</Card>
                    </List.Item>
                )}
            />
        </div>
    );
};

export default ProductList;
